import React, { useState, useEffect } from 'react';
import { fetchLineItemProcesses, fetchExecutionDetailsGrouped, updateExecutionDetails } from '../services/api';

const ExecutionDetailsPage = () => {
  const [pendingLineItems, setPendingLineItems] = useState([]);
  const [inProgressLineItems, setInProgressLineItems] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        // Fetch line items from lineitemprocesses table
        const lineItemProcesses = await fetchLineItemProcesses();

        // Fetch grouped execution details from executiondetails table
        const executionData = await fetchExecutionDetailsGrouped();

        // Separate Pending Line Items (Not yet processed)
        const pending = lineItemProcesses.filter(item => !executionData.some(exec => 
          exec.lineItems.some(li => li.lineItemId === item.lineItemId)
        ));

        // Separate In-Progress Line Items (Processing started but not completed)
        const inProgress = executionData.filter(exec => exec.status === 'In Progress')
          .flatMap(exec => exec.lineItems.map(item => ({
            lineItemId: item.lineItemId,
            orderId: item.orderId,
            processId: exec.processId,
            vendorId: exec.vendorId,
            outWeight: item.outWeight,
            piecesSent: item.piecesSent,
            dateSent: item.dateSent,
            status: exec.status,
          })));

        setPendingLineItems(pending);
        setInProgressLineItems(inProgress);
      } catch (error) {
        console.error('Error fetching execution details:', error.message);
      }
    };

    fetchData();
  }, []);

  const handleUpdateExecution = async (executionId, updatedLineItems, status) => {
    await updateExecutionDetails(executionId, { updatedLineItems, status });
    alert("Execution updated successfully!");
    window.location.reload();
  };

  return (
    <div>
      <h2>Execution Management</h2>

      {/* Pending Line Items Table */}
      <h3>Pending Line Items</h3>
      {pendingLineItems.length > 0 ? (
        <table border="1">
          <thead>
            <tr>
              <th>Order ID</th>
              <th>Line Item ID</th>
              <th>Process</th>
              <th>Vendor</th>
            </tr>
          </thead>
          <tbody>
            {pendingLineItems.map((item, index) => (
              <tr key={index}>
                <td>{item.orderId}</td>
                <td>{item.lineItemId}</td>
                <td>{item.processId}</td>
                <td>{item.vendorId}</td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No pending line items.</p>
      )}

      {/* In Progress Line Items Table */}
      <h3>In Progress Line Items</h3>
      {inProgressLineItems.length > 0 ? (
        <table border="1">
          <thead>
            <tr>
              <th>Order ID</th>
              <th>Line Item ID</th>
              <th>Process</th>
              <th>Vendor</th>
              <th>Weight Sent</th>
              <th>Pieces Sent</th>
              <th>Date Sent</th>
              <th>Date Received</th>
              <th>Status</th>
            </tr>
          </thead>
          <tbody>
            {inProgressLineItems.map((item, index) => (
              <tr key={index}>
                <td>{item.orderId}</td>
                <td>{item.lineItemId}</td>
                <td>{item.processId}</td>
                <td>{item.vendorId}</td>
                <td>{item.outWeight}</td>
                <td>{item.piecesSent}</td>
                <td>{item.dateSent}</td>
                <td>
                  <input type="date" onChange={(e) => handleUpdateExecution(item.executionId, [{ ...item, dateReceived: e.target.value }], item.status)} />
                </td>
                <td>{item.status}</td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No line items in progress.</p>
      )}
    </div>
  );
};

export default ExecutionDetailsPage;
